$(document).ready((function(){$(".mydatatable").DataTable({dom:"Bfrtip",buttons:["copy","csv","excel","pdf","print"],scrollY:300,scrollX:!0,autoWidth:!1,scrollCollapse:!0,paging:!1})}));const signUpButton=document.getElementById("signUp"),signInButton=document.getElementById("signIn"),container=document.getElementById("container");signUpButton.addEventListener("click",()=>{container.classList.add("right-panel-active")}),signInButton.addEventListener("click",()=>{container.classList.remove("right-panel-active")});